import React, { useEffect, useState } from 'react'
import axios from 'axios';
const TableEmployee = () => {
    const [data, setData] = useState([])
    useEffect(() => {
      fetch('https://7d69-210-245-110-144.ngrok-free.app/employees')
      .then((response) => response.json())
      .then((data) => {
         console.log(data);
      })
      .catch((err) => {
         console.log(err.message);
      });
}, []);
    return (
        <div>
            <div>
                <form action=''>
                    <input type='text' placeholder='Enter Name '/>
                    <button>Add</button>
                </form>
            </div>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        data.map((user, index) => {
                            <tr key={index}>
                                <td>{user.employees_id}</td>
                                <td>{user.employees_name}</td>
                                <td>
                                    <button>Edit</button>
                                    <button>Delete</button>
                                </td>
                            </tr>
                        })
                    }
                </tbody>
            </table>
        </div>
    )
}

export default TableEmployee
